import './App.css';
import Routing from './Components/Routing';
import { createContext } from 'react';

function App() {
  const UserContext = createContext(null);
  return (
   <>
   <UserContext value>
    <Routing></Routing>
    </UserContext>
   </>
  );
}

export default App;
